import './App.css';
import HeroDetail from './components/HeroDetails/Hero-details';
import Heroes from './components/Heroes/Heroes';

const App = () => {
  return (
    <div className="App">
      <h1>Tour of Heroes</h1>
        <h2>My Heroes</h2>
        <Heroes />
        <HeroDetail/>
    </div>
  );
}

export default App;
